import React from 'react';
import styled from 'styled-components';
const ProductCard = () => {
    return(
        <CardContainer>
            <ProductImage></ProductImage>
            <ProductInfo></ProductInfo>
        </CardContainer>
    )
}

export default ProductCard;

const CardContainer = styled.div`
    width: 200px;
    height: 300px;
    background-color: #e5e5e5;
`
